gram.started','true','DO NOT MODIFY. true/false whether or not the form2program module has been started.  This is used to make sure modules that were running  prior to a restart are started again',36,'b54cb276-2695-102d-b4c2-001d929acb54'),('formdataexport.database_version','1.8','DO NOT MODIFY.  Current database version number for the formdataexport module.',37,'b54cb352-2695-102d-b4c2-001d929acb54'),('formdataexport.started','true','DO NOT MODIFY. true/false whether or not the formdataexport module has been started.  This is used to make sure modules that were running  prior to a restart are started again',38,'b54cb424-2695-102d-b4c2-001d929acb54'),('formentry.database_version','2.6','DO NOT MODIFY.  Current database version number for the formentry module.',39,'b54cb4f6-2695-102d-b4c2-001d929acb54'),('formentry.infopath_server_url','http://neno.apzunet:8080/openmrs','When uploading an XSN, this url is used as the \"base path\".  (Should be something like http://localhost:8080/openmrs)',41,'b54cb5be-2695-102d-b4c2-001d929acb54'),('formentry.infopath_taskpane_caption','Welcome!','The text seen in the infopath taskpane upon first logging in',42,'b54cb690-2695-102d-b4c2-001d929acb54'),('formentry.infopath_taskpane_keepalive_min','','The number of minutes to keep refreshing the taskpane before allowing \r\nthe login to lapse',43,'b54cb758-2695-102d-b4c2-001d929acb54'),('formentry.infopath_taskpane_refresh_sec','','The number of seconds between taskpane refreshes.  This keeps the taskpane from\r\nlogging people out on longer forms',44,'b54cba00-2695-102d-b4c2-001d929acb54'),('formentry.patientForms.goBackOnEntry','false','\'true\' means have the browser go back to the find patient page after picking a form\r\nfrom the patientForms tab on the patient dashboard page',45,'b54cbad2-2695-102d-b4c2-001d929acb54'),('formentry.queue_archive_dir','formentry/archive/%Y/%M','Directory containing the formentry archive items.  This will contain xml files that have\r\nbeen submitted