p=[ART_FOLLOWUP|sinceDate=${report.startDate}|untilDate=${report.endDate}]\r\n\r\nhadArtEncounter=#hadArtInitial# OR #hadArtFollowup#\r\n\r\nartRegLastWeek=[REGISTRATION|location=9|withinLastDays=7]\r\nartRegTwoWeeks=[REGISTRATION|location=9|withinLastDays=14]\r\nartRegWeekAgo=#artRegTwoWeeks# NOT #artRegLastWeek#\r\n\r\nartAptLastWeek=[APPOINTMENT|location=9|withinLastDays=7]\r\nartAptTwoWeeks=[APPOINTMENT|location=9|withinLastDays=14]\r\nartAptWeekAgo=#artAptTwoWeeks# NOT #artAptLastWeek#\r\n\r\nartScanWeekAgo = #artRegWeekAgo# OR #artAptWeekAgo#\r\nanyHIV = [Patients in HIV Program] OR [EID Program] OR [KS Program]\r\n\r\nartVisitNotEnrolled = #artScanWeekAgo# NOT #anyHIV#\r\n\r\n//Status Macros\r\ntransferredIn=[Transfer_In|sinceDate=${report.startDate}|untilDate=${report.endDate}]\r\ntransfInArt=#transferredIn#\r\n\r\nnewArt=#hadArtInitial# OR #transfInArt#\r\n\r\n//Drug Regimen Macros\r\n\r\n//First Line Sets\r\nonT30=[Drug|drugList=2|sinceDate=${report.startDate}|untilDate=${report.endDate}]\r\neverOnT30=[Drug|drugList=2|sinceDate=${report.startDate}|untilDate=${report.endDate}]\r\nonT40=[Drug|drugList=3|sinceDate=${report.startDate}|untilDate=${report.endDate}]\r\nonLS30=[currDrug|drugList=70|]\r\nonLamBaby=[Drug|drugList=71|sinceDate=${report.startDate}|untilDate=${report.endDate}]\r\nonTriBaby=[Drug|drugList=72|sinceDate=${report.startDate}|untilDate=${report.endDate}]\r\n\r\n//Second Line Sets\r\nonEFV=[Drug|drugList=11|drugList=28|drugList=29|drugList=30|sinceDate=${report.startDate}|untilDate=${report.endDate}]\r\n\r\n//Program State Sets\r\nhivDeadLowerLimit=[progStateOnOrBefore|program=1|stateList=3|untilDate=${report.startDate-1}]\r\nhivDeadOnOrAfter=[progStateOnOrAfter|program=1|stateList=3|sinceDate=${report.startDate}]\r\nhivDeadUpperLimit=[progStateOnOrAfter|program=1|stateList=3|sinceDate=${report.endDate+1}]\r\nhivDeadRange=#hivDeadOnOrAfter# NOT (#hivDeadLowerLimit# OR #hivDeadUpperLimit#)','',93,'b54d04ce-2695-102d-b4c2-001d929acb54'),('scheduler.password','pa55ionFruit','Password for the OpenMRS user that will perform the scheduler activities',94,'b54d0640-2695-102d-b4c2-001d929acb54'),('scheduler.username','admin','Username for the OpenMRS user that will perform the scheduler activities',95,'b54d0708-2695-102d-b4c2-001d929acb54'),('smtp_server','localhost','',96,'b54d07c6-2695-102d-b4c2-001d929acb54'),('user.listingAttributeTypes','','',97,'23dbfc81-f578-4ab2-8331-1dc8ce839fc3'),('user.viewingAttributeTypes','','',98,'b1b13950-e89b-4218-afb1-5bd54540391c'),('use_patient_attribute.healthCenter','false','Indicates whether or not the \'health center\' attribute is shown when viewing/searching for patients',99,'b54d09ec-2695-102d-b4c2-001d929acb54'),('use_patient_attribute.mothersName','false','Indicates whether or not mother\'s name is able to be added/viewed for a patient',100,'b54d0ab4-2695-102d-b4c2-001d929acb54'),('use_patient_attribute.tribe','true','Indicates whether or not the \'tribe\' attribute is shown when viewing/searching for patients',101,'b54d0b7c-2695-102d-b4c2-001d929acb54'),('smtp_username','baobabhealth','',102,'b54d0cb2-2695-102d-b4c2-001d929acb54'),('mdrtb.database_version','1.0.3','DO NOT MODIFY.  Current database version number for the mdrtb module.',103,'b54d0d84-2695-102d-b4c2-001d929acb54'),('mdrtb.started','false','DO NOT MODIFY. true/false whether or not the mdrtb module has been started.  This is used to make sure modules that were running  prior to a restart are started again',104,'b54d0e4c-2695-102d-b4c2-001d929acb54'),('mdrtb.program_name','MDR-TB PROGRAM','MDR-TB program name.',105,'b54d1112-2695-102d-b4c2-001d929acb54'),('mdrtb.treatment_supporter_person_attribute_type','Treatment Supporter','The person attribute type that corresponds to being a treatment supporter/acompanateur/dots worker.',106,'b54d11e4-2695-102d-b4c2-001d929acb54'),('mdrtb.patient_identifier_type_list','','Pipe delimited list of all patient identifier types associated with the MDRTB program.',107,'b54